function array2String(array1, separator){
    if(array1){
        var result='';
        for(var i=0; i<array1.length; i++){
        	  if(i==0)
        	     result=array1[i];
        	  else
         	     result=result+separator+array1[i];
        }
        return result;
    }
    return '';
}

function object2String(obj, separator){
    if(obj){
        var result='';
        var i=0;
        for(field in obj){
        	  if(!field.startsWith('p')){
        	      continue;
        	  }
        	  if(i==0)
        	     result=field+':'+obj[field];
        	  else
         	     result=result+separator+field+':'+obj[field];
         	  i++;
        }
        return result;
    }
    return '';
}


