function toggleData_parkview(data, name){
                var angle = data.angle,
                    pop = data.pop;
            
                if(angle != null){
                    if(anim){
                        anim.stop(true);
                    }
                    var oldAngle = data.window ? data.getRotationX() : data.getRotation();
                    if(data.open){
                        angle = -angle;
                    }
                    data.open = !data.open;
                    anim = ht.Default.startAnim({
                        action: function(v){
                            if(data.window){
                                data.setRotationX(oldAngle + v * angle);    
                            }else{
                                data.setRotation(oldAngle + v * angle);
                            }                                
                        }
                    });
                }
                else if(pop != null){
                    if(anim){
                        anim.stop(true);
                    }
                    var p3 = data.p3(),
                        s3 = data.s3(),
                        dist = pop ? -s3[2] : s3[2];
                    data.pop = !data.pop;                        
                    if(data.pop){
                        data.s({
                            'note': 'Detail...',  
                            'note.background': '#3498DB',
                            'note.font': '26px Arial',
                            'note.position': 6,
                            'note.t3': [-30, -3, 30],
                            'note.expanded': true,
                            'note.toggleable': false,
                            'note.autorotate': true                        
                        });                                     
                    }else{
                        data.s('note', null);
                    }                                                
                    anim = ht.Default.startAnim({
                        action: function(v){
                            data.p3(p3[0], p3[1], p3[2] + v * dist);                                                               
                        }
                    }); 
                }            
}

